import React from 'react';
import { Label, StyledInput } from './styles';

export interface IInput {
  label?: string;
  placeholder?: string;
}

const Input: React.FC<IInput> =
  ({ label,
     placeholder }) => {
  return (
    <>
      <Label>{label}</Label>
      <StyledInput placeholder={placeholder} />
    </>
  )
}

export default Input;
